console.log("hey")

window.onload = function(){
    document.getElementsByClassName("checkbox").forEach(x => x.addEventListener('change',function(){
        console.log("re");
        getCheckedBox();
    })
    )
};
function getCheckedBox(){
    var checkedBoxes = document.getElementsByClassName('checkbox');
    console.log(checkedBoxes)
}
